import React from 'react';
import './home.css';

export default function Home() {
    return (
        <div>
            <div className='home-header'>
                <h1>Hi I'm Logan, a Software Engineer, a Data Engineer, and lifelong learner.</h1>
                <img src="./assets/nerd.png" alt="coder"></img>
            </div>

        </div>
    )
}
